import React from 'react'
import { Link } from 'react-router-dom'
import { connect } from 'react-redux'

class ScoreItem extends React.Component{
    componentDidMount() {
        const id = this.props.match.params.id || ''
    }

    render() {
        const { doneTasks } = this.props
        return(
            <tr>
                <td>{doneTasks.id}</td>
                <td><Link to={`/id${doneTasks.id}`}>{doneTasks.name}</Link></td>
                <td>{doneTasks.startTime.hours}:{doneTasks.startTime.minutes}</td>
                <td>{doneTasks.stopTime.hours}:{doneTasks.stopTime.minutes}</td>
                <td>{doneTasks.duration}s</td>
            </tr>
        )
    }
}

const mapStateToProps = state => {
    return {
        doneTasks: state.doneTasks
    }
}

export default connect(mapStateToProps)(ScoreItem)
